import { Component } from '@angular/core';

interface Vehicle {
  name: string;
  license: string;
  owner: string;
  entry: Date;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  vehicles: Vehicle[] = [];
  showHistoryWindow = false;

  registerVehicle(): void {
    const nameInput = document.getElementById('name') as HTMLInputElement;
    const licenseInput = document.getElementById('licence') as HTMLInputElement;
    const ownerInput = document.getElementById('owner') as HTMLInputElement;

    const name = nameInput.value;
    const license = licenseInput.value;
    const owner = ownerInput.value;
    const entry = new Date();

    if (name && license && owner) {
      const vehicle: Vehicle = { name, license, owner, entry };
      this.vehicles.push(vehicle);
      nameInput.value = '';
      licenseInput.value = '';
      ownerInput.value = '';
    }
  }

  showHistory(): void {
    this.showHistoryWindow = true;
  }

  closeHistoryWindow(): void {
    this.showHistoryWindow = false;
  }

  removeVehicle(index: number): void {
    const vehicle = this.vehicles[index];
    const now = new Date();
    const diff = Math.abs(now.getTime() - vehicle.entry.getTime());
    const hours = Math.ceil(diff / (1000 * 60 * 60));

    if (confirm(`Deseja remover o veículo "${vehicle.name}"? Tempo estacionado: ${hours} horas`)) {
      this.vehicles.splice(index, 1);
    }
  }
}
<!DOCTYPE html>

<div class="barra-superior">
  <img src="assets/Logo.png" alt="Logo" class="logo-img">
  <h1 class="title">EstacionaCar</h1>
  <button (click)="showHistory()" style="width: 100px; height: 50px;color: rgb(255, 255, 255);background-color: #850a0a; ;border-width: 3px; border-style: solid;font-weight: bold;
    border-color:  rgb(12, 12, 12);">Exibir Histórico</button>
</div>

<div>
  <input type="text" id="name" placeholder="Nome do veículo" autocomplete="off">
  <input type="text" id="licence" placeholder="Placa do veículo" autocomplete="off">
  <input type="text" id="owner" placeholder="Proprietário" autocomplete="off">
  <button (click)="registerVehicle()" class="success">Registrar</button>
</div>

<table class="table">
  <thead>
    <tr>
      <th>Veículo</th>
      <th>Placa</th>
      <th>Proprietário</th>
      <th>Entrada</th>
      <th>Ações</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let vehicle of vehicles; let i = index">
      <td>{{ vehicle.name }}</td>
      <td>{{ vehicle.license }}</td>
      <td>{{ vehicle.owner }}</td>
      <td>{{ vehicle.entry | date:'medium' }}</td>
      <td>
        <button (click)="removeVehicle(i)" class="delete">Remover</button>
        <button (click)="editVehicle(i)">Editar</button>
      </td>
    </tr>
  </tbody>
</table>

<div *ngIf="showHistoryWindow" class="history-window">
  <button (click)="closeHistoryWindow()" class="close-button">Fechar</button>
  <table class="table">
    <thead>
      <tr>
        <th>Veículo</th>
        <th>Placa</th>
        <th>Proprietário</th>
        <th>Entrada</th>
        <th>Tempo Estacionado</th>
        <th>Ações</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let vehicle of vehicles">
        <td>{{ vehicle.name }}</td>
        <td>{{ vehicle.license }}</td>
        <td>{{ vehicle.owner }}</td>
        <td>{{ vehicle.entry | date:'medium' }}</td>
        <td>{{ getElapsedTime(vehicle.entry) }}</td>
        <td>
          <button (click)="removeVehicle(getVehicleIndex(vehicle))" class="delete">Remover</button>
          <button (click)="editVehicle(getVehicleIndex(vehicle))">Editar</button>
        </td>
      </tr>
    </tbody>
  </table>
</div>

<img class="imagem-direita" src="assets/tabela.png" alt="SDSC">
